import './App.css';
import { React } from 'react';
import SignUp from './SignUp';
import Login from './Login';
import Homescreen from './Homescreen';
import {useLocation,BrowserRouter as Router,Route,Routes, createBrowserRouter ,RouterProvider } from 'react-router-dom';


function App() {
    const location=useLocation();
    const router = createBrowserRouter([
        {
            path: "/",
            element: <Login />
        },
        {
            path:"/SignUp",
            element:<SignUp/>
        },
        {
            path:"/Homescreen",
            element:<Homescreen/>
        }
    ])
    return (
        <>

            {}(<div className="bg-green-300 h-20 flex justify-center text-4xl py-2">Chat-App</div>)
            <RouterProvider router={router}/>
        </>
    );
}

export default App;
